-- DDL
create schema if not exists zelenikhin;

-- SALE
drop table if exists zelenikhin.sale;
create table zelenikhin.sale(
	row_id		SERIAL primary key,
	sale_date	DATE not null,
	salesman_id	INTEGER not null,
	item_id		VARCHAR(5) not null,
	quantity	INTEGER not null,
	final_price	INTEGER not null	
);

-- PRODUCT
drop table if exists zelenikhin.product;
create table zelenikhin.product(
	row_id		SERIAL primary key,
	id			VARCHAR(5) not null,
	name 		VARCHAR(40) not null,
	price		INTEGER not null,
	sdate		DATE not null,
	edate		DATE not null,
	is_actual	BOOL not null
);

-- SERVICE
drop table if exists zelenikhin.service;
create table zelenikhin.service(
	row_id		SERIAL primary key,
	id			VARCHAR(5) not null,
	name		VARCHAR(20) not null,
	price		INTEGER not null,
	sdate		DATE not null,
	edate		DATE not null,
	is_actual	BOOL not null
);

-- SELLER
drop table if exists zelenikhin.seller;
create table zelenikhin.seller(
	row_id			SERIAL primary key,
	id				INTEGER not null,
	fio				VARCHAR(30) not null,
	department_id	INTEGER not null
);

-- DEPARTMENT
drop table if exists zelenikhin.department;
create table zelenikhin.department(
	row_id			SERIAL primary key,
	filial_id		INTEGER not null,
	department_id	INTEGER not null,
	dep_chif_id		INTEGER not null
);


