-- DML
SELECT * -- 714
FROM (
	/*    */
	SELECT *
	FROM (
		SELECT -- 253
			'month' 								AS period_type,
			date_trunc('month', sale_date)::date 	AS start_date,
			(date_trunc('month', sale_date) + '1 month'::interval - '1 day'::interval)::date AS end_date,
			fio_seller 								AS salesman_fio,
			fio_chif 								AS chif_fio,
			count(final_price) 						AS sales_count,
			sum(final_price) 						AS sales_sum,
			first_value(max(name)) OVER (PARTITION BY date_trunc('month', sale_date)::date ORDER BY MAX(final_price - price * quantity) DESC) AS max_overcharge_item,
			round(max((final_price::decimal) / (price::decimal * quantity) - 1)*100) AS max_overcharge_percent
		FROM (
			SELECT * -- 3 000
			FROM (
				SELECT * -- 2 516 products
				FROM zelenikhin.sale s LEFT JOIN zelenikhin.product p ON s.item_id = p.id
				WHERE sale_date BETWEEN sdate AND edate
			UNION
				SELECT * -- 484 services
				FROM zelenikhin.sale s LEFT JOIN zelenikhin.service srv ON s.item_id = srv.id
				WHERE sale_date BETWEEN sdate AND edate
				) AS sales
		INNER JOIN -- ONLY 589 SALES WITH SELLER INFORMATION (!)
			(SELECT slr.id, slr.fio AS fio_seller, d.filial_id, slr2.fio AS fio_chif
			FROM zelenikhin.seller slr
				LEFT JOIN zelenikhin.department d ON slr.department_id = d.department_id
				LEFT JOIN zelenikhin.seller slr2 ON d.dep_chif_id = slr2.id
			) AS sellers
		ON sales.salesman_id = sellers.id) AS q1
		GROUP BY fio_seller, start_date, end_date, chif_fio
		HAVING sum(final_price) NOTNULL
		) AS month_period
	UNION  
	/*    */
	SELECT *
	FROM (
		SELECT -- 461
			'week' 									AS period_type,
			date_trunc('week', sale_date)::date 	AS start_date,
			(date_trunc('week', sale_date)+ '6 days'::interval)::date AS end_date,
			fio_seller 								AS salesman_fio,
			fio_chif 								AS chif_fio,
			count(final_price) 						AS sales_count,
			sum(final_price) 						AS sales_sum,
			first_value(max(name)) OVER (PARTITION BY date_trunc('week', sale_date)::date ORDER BY MAX(final_price - price * quantity) DESC) AS max_overcharge_item,
			round(max((final_price::decimal) / (price::decimal * quantity) - 1)*100) AS max_overcharge_percent
		FROM (
			SELECT * -- 3 000
			FROM (
				SELECT * -- 2 516 products
				FROM zelenikhin.sale s LEFT JOIN zelenikhin.product p ON s.item_id = p.id
				WHERE sale_date BETWEEN sdate AND edate
			UNION
				SELECT * -- 484 services
				FROM zelenikhin.sale s LEFT JOIN zelenikhin.service srv ON s.item_id = srv.id
				WHERE sale_date BETWEEN sdate AND edate
				) AS sales
		INNER JOIN -- ONLY 589 SALES WITH SELLER INFORMATION (!)
			(
			SELECT slr.id, slr.fio AS fio_seller, d.filial_id, slr2.fio AS fio_chif
			FROM zelenikhin.seller slr
				LEFT JOIN zelenikhin.department d ON slr.department_id = d.department_id
				LEFT JOIN zelenikhin.seller slr2 ON d.dep_chif_id = slr2.id
			) AS sellers
		ON sales.salesman_id = sellers.id
			) AS q2
		GROUP BY fio_seller, start_date, end_date, chif_fio
		HAVING sum(final_price) NOTNULL
		) AS week_period
	) AS all_period
ORDER BY salesman_fio, start_date;
